import React from 'react'
import styled from 'styled-components'

const Box = styled.div`
width: 55vw;
display: flex;
background: linear-gradient(
    to right;
    ${props => props.theme}
)

`

const Intro = () => {
  return (
    <Box>
        Intro
    </Box>
  )
}

export default Intro
